import { createApp } from 'vue'
import App from './App.vue'
import {router} from "./components/routers/route"
import{ auth } from "./components/firebaseconf.js"
import {  onAuthStateChanged} from "firebase/auth";
const kontrol= onAuthStateChanged(auth,(user)=>{
    console.log("home vue içinde");
if (user ===  null) {
  this.$router.push("/")
  } })

const app =createApp(App)
app.use(kontrol)
app.use(router)
app.mount('#app')
